import './App.css';
import Grid from './components/Grid.js'
import Navbar from './components/Navbar.js'

function App() {
  function click() {
    console.log("hi");
  }

  return (
    <div className="App">
      <div className="content">
        <Navbar />
        <Grid />
        <button onClick={click}>Make Maze</button>
      </div>
    </div>
  );
}

export default App;
